import {useState, useEffect} from 'react'
import {getUserByUsername, usernameifAuthorized, getTrackers} from '../../API/Axios'
import {Tracker, Goal, Exercise, Nutrition} from './Inbox';
import {Line} from 'react-chartjs-2';

interface viewerProp {
	goalId : number;
	clicked : boolean;
}

function NotiViewer(prop : viewerProp)
{
	// Get Trackers for that Goal
	const [trackers, setTrackers] = useState<Tracker[]>([]);

	const getData = async () => {
		
		let username = await usernameifAuthorized();
		let user = await getUserByUsername(username);
		let trackers : Tracker[] = await getTrackers(user.id, prop.goalId);
		return trackers;
	}
	console.log(getData());
	// Separate the Data into Arrays for each Value Tracked::
	let data = getData();
	const datavis = {
	burnedCal : [],
	duration : [],
	volume : [],
	carb: [],
	fat: [],	
	kal: [],
	protein: [],		
	weight: [],
	sleep: [],
	water: []
	};
	
	data.then( (data) => {
		data.map( (tracker:Tracker) => {
			datavis.burnedCal.push(tracker.exercise.burnedCal);
		})
	})
	return (
		<>
		{prop.clicked &&
		<div> Test </div>
		}
		</> 
	)
}

export default NotiViewer
